import './Contact.css';

export function Contact() {
    return (
        <>
        <div class="contact">
            <div class="contactMain">
                <h1>Reach out to me!</h1>
                <br/>
                <p>thank you for taking the time to peruse my page! If you have any questions, comments, concerns,
                    email me at jackson_ho@brown.edu
                </p>
            </div>
        </div>
        </>

    )
}
